export const Box = styled.div`
    border: solid;
    border-weight: 2px;
    border-radius: 10px;
    background-color: #272727;
    border-color: #656565;

    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;

    padding: 50px;
`
